// ProjectsLayout.jsx (short snippet)
import React from 'react';
import ProjectCard from './ProjectCard';

function ProjectsLayout() {
  return (
    <section id="projects" className="section">
      <div className="container">
        <h2 className="title has-text-centered is-size-3 mb-5" style={{ color: '#fff' }}>
          Browse My Portfolio
        </h2>
        {/* Finance, Ecom, TicTacToe, CurrencyConverter */}
        {/* e.g. <ProjectCard ... /> */}
      </div>
    </section>
  );
}
export default ProjectsLayout;
